import './App.css';
import React, {useEffect, useState} from 'react';
import {Box, FormControl, Grid, InputLabel, MenuItem, Select} from "@mui/material";
import { DemoContainer } from '@mui/x-date-pickers/internals/demo';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import TableContainer from "@mui/material/TableContainer";
import Paper from "@mui/material/Paper";
import TableHead from "@mui/material/TableHead";
import Table from "@mui/material/Table";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import TableBody from "@mui/material/TableBody";
import Chart from "./components/Chart";
import Button from '@mui/material/Button';


function App() {
  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);
  const [currencySelectValue, setCurrencySelectValue] = React.useState('');
  const [currentDb, setCurrentDb] = React.useState('');
  const [currencies, setCurrencies] = React.useState([]);

  axios.get('http://localhost:8080/postgres/currencies')
      .then(function (response) {

      })

  useEffect(() => {
    fetch(`http://localhost:8080/postgres/currencies`)
        .then((response) => response.json())
        .then((actualData) => console.log(actualData));
  }, []);



  return (
      <div className="App" style={{display:"flex",alignItems:"center", flexDirection:"column"}}>

        <Grid container spacing={2} sx={{maxWidth: '1300px',mt:'50px',alignItems: 'flex-end',justifyContent: 'center' }}>

          <Grid item xs={2}>
            <LocalizationProvider dateAdapter={AdapterDayjs}>
              <DemoContainer components={['DatePicker']}>
                <DatePicker label="From" value={startDate} onChange={(newValue) => setStartDate(newValue)} />
              </DemoContainer>
            </LocalizationProvider>
          </Grid>

          <Grid item xs={2}>
            <LocalizationProvider dateAdapter={AdapterDayjs}>
              <DemoContainer components={['DatePicker']}>
                <DatePicker label="To" value={endDate} onChange={(newValue) => setEndDate(newValue)} />
              </DemoContainer>
            </LocalizationProvider>
          </Grid>

          <Grid item xs={2}>
            <Box >
              <FormControl fullWidth>
                <InputLabel id="demo-simple-select-label">currencySelectValue</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={currencySelectValue}
                    label="currency"
                    onChange={(event)=>setCurrencySelectValue(event.target.value)}
                >
                  <MenuItem value={10}>PLN</MenuItem>
                  <MenuItem value={20}>USD</MenuItem>
                  <MenuItem value={30}>GBP</MenuItem>
                </Select>
              </FormControl>
            </Box>
          </Grid>

          <Grid item xs={2}>
            <Box >
              <FormControl fullWidth>
                <InputLabel id="demo-simple-select-label">Database</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={currentDb}
                    label="currency"
                    onChange={(event)=>setCurrentDb(event.target.value)}
                >
                  <MenuItem value={10}>PostgreSQL</MenuItem>
                  <MenuItem value={20}>MongoDB</MenuItem>
                  <MenuItem value={30}>Elastic</MenuItem>
                </Select>
              </FormControl>
            </Box>
          </Grid>

          <Grid item xs={1}><Button variant="outlined" sx={{mb:'10px'}}>Display</Button></Grid>

        </Grid>

        <Chart/>


        <TableContainer component={Paper} sx={{maxWidth: '80%'}}>
          <Table sx={{ backgroundColor:'#F3F4F7' }} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell align="center">Test case</TableCell>
                <TableCell align="center">PostgreSQL</TableCell>
                <TableCell align="center">MongoDB</TableCell>
                <TableCell align="center">Elastic</TableCell>
                <TableCell align="center"></TableCell>
              </TableRow>
            </TableHead>
            <TableBody>

                  <TableRow
                      sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                  >
                    <TableCell align="center">Test1</TableCell>
                    <TableCell align="center">0s</TableCell>
                    <TableCell align="center">0s</TableCell>
                    <TableCell align="center">0s</TableCell>
                    <TableCell align="center"><Button variant="outlined">Run</Button></TableCell>
                  </TableRow>

            </TableBody>
          </Table>
        </TableContainer>

      </div>
  );
}

export default App;
